function Invoke-rtoken {
    param([string]$Nonce)

    $a = ""

    $RASa = [System.Reflection.Assembly]::Load([Convert]::FromBase64String($a))

    $OldConsoleOut = [Console]::Out
    $StringWriter = New-Object IO.StringWriter
    [Console]::SetOut($StringWriter)
    
    $type = $RASa.GetType("ROADToken.Program")
    $main = $type.GetMethod("Main", [System.Reflection.BindingFlags]"Static,NonPublic")
    $main.Invoke($null, @(,[string[]]@($Nonce)))
    
    [Console]::SetOut($OldConsoleOut)
    $Results = $StringWriter.ToString()
    $Results
}
